import React, { useEffect } from "react";
import './Home.css'
import { useLocation } from "react-router-dom";
import Profile from "./Profile/Profile";
const Home=(props)=>{
    const location=useLocation();
    const {name,password,email,gender,cityName,residationType,society}=location.state || {};
    const [formData,setformData]={
        cityName:"",
        society:"",
        residationType
    }
    const changeHandler=(e)=>{
        const {name,value}=e.target;
        setformData({
            ...formData,
            [name]:value
        })
    }

return(<div>
    <div className="container-home">
            <header>
                <nav>
                    <ul>
                        <li><a href="#">Home</a></li>
                    </ul>
                </nav>
            </header>
            <div className="profile-home">
            <Profile  name={name} email={email} password={password} gender={gender}/>
            <div className="info">
                    <input className="address-home" value={props.cityName}/>
                    <input className="address-home" value={props.society}/>
                    <input className="address-home" value={props.residationType}/>
                    {props.btn? <button className="btn-home" onClick={props.clicked} >+</button>:""}  
            </div>
            </div>
            
       
    </div>
</div>)
}

export default Home;
